void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy;
    vec2 u = uv - 0.5;    

    u.x *= 0.8;
    float t = iTime * 1.2;
    //u.y +=sin(t*7.1-u.x*7.0)*0.1;
    u.y +=sin(t*237.1)*0.1;

    u.x -= sin(u.x);
    u.x = sin(u.x*100.)*0.7;


    float k = clamp(length(u), 0.001, 1.0);
    vec3 col = vec3(k);
    col.b += uv.y * 0.2;
    col.r += uv.y * 0.9;
    col = sin(col*2.1);
    fragColor = vec4(col,1.0);
}
